  `allkgcost` decimal(10,2) NOT NULL COMMENT \'重量价格\',
  `allkmcost` decimal(10,2) NOT NULL COMMENT \'距离价格\',
  `farecost` decimal(10,2) NOT NULL COMMENT \'加价（小费）\',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=32 DEFAULT CHARSET=utf8',
